import { ChangeDetectorRef, Component, Injectable, NgZone } from '@angular/core';
import { JwtHelperService } from '@auth0/angular-jwt';
import { AuthService } from 'src/app/auth/auth.service';
import { MovieGetDTO } from 'src/app/models/movieGetDTO.model';
import { RoleEnum } from 'src/app/models/userEnums.model';
import { UserGetDTO } from 'src/app/models/userGetDTO.model';
import { UserService } from 'src/app/user.service';
import { environment } from 'src/env/env';

@Injectable()
@Component({
  selector: 'app-nav-bar',
  templateUrl: './nav-bar.component.html',
  styleUrls: ['./nav-bar.component.css']
})
export class NavBarComponent {
  constructor(private authService: AuthService,private userService:UserService) {}
  user:UserGetDTO;
  role: RoleEnum ;
 // private cdr: ChangeDetectorRef;
  
  
  ngOnInit(): void {
 
  
    this.authService.userState.subscribe((result) => {
      if(result != null){
        this.role = result.role;
      }else{
       this.role=RoleEnum.UNAUTHENTICATED;
      }
     // this.cdr.detectChanges();
    })
  }

  logout(): void {
    console.log("LOG OUT ")
    this.authService.logout();
  }

  isLoggedIn(): boolean {
    return this.authService.isLoggedIn();
  }

  isAdmin(): boolean {
    console.log("USAO U IS ADM")
    console.log('ROLA JE ', this.role)
 
    return this.authService.getRole() == RoleEnum.ADMIN;
  }

  isGuest(): boolean {
    return this.authService.getRole() == RoleEnum.GUEST;
  }

  isOwner(): boolean {
    return this.authService.getRole() == RoleEnum.OWNER;
  }

  testClicked(){
    console.log('Dugme je kliknuto!');
    this.userService.getAllMovies().subscribe(
      (movies: MovieGetDTO[]) => {
        console.log('Svi filmovi:', movies);
      },
      error => {
        console.error('Greška pri dohvaćanju filmova:', error);
      }
    );
  }
  

 }
 



<mat-toolbar>
  <span class="logo-text">Explore, watch, enjoy!</span>

  <!-- <div class="search-container">
    <form class="example-form">
      <mat-form-field class="example-full-width"> -->
        <mat-form-field class="mojaklasa">
        
        <input type="text"  class ='tekstic' matInput placeholder="Search movie"/>
        <mat-icon  matSuffix>search</mat-icon>
       
       </mat-form-field>
    <!-- </form>
  </div>  -->

  <div class="button-container">
    <button *ngIf="isLoggedIn()" [routerLink]="['myNotifications']" mat-raised-button>
      <mat-icon>notifications</mat-icon>
    </button>
    <!-- <button   mat-raised-button  (click)="testClicked()">Testic</button> -->
   
    <button *ngIf="role == 'ADMIN'" [routerLink]="['adminRatingRequests']" mat-raised-button>Rating requests</button>
    <button *ngIf="role == 'OWNER'" [routerLink]="['ownersAccommodations']" mat-raised-button>My Accommodations</button>
    <button *ngIf="role == 'GUEST'" [routerLink]="['guestsReservations']" mat-raised-button>My Reservations</button>
    <button *ngIf="role == 'ADMIN'" [routerLink]="['accommodationsRequests']" mat-raised-button>Accommodation requests</button>
    <button *ngIf="role == 'OWNER'" [routerLink]="['createAccommodation']" mat-raised-button>Create Accommodation</button>
    <button *ngIf="role == 'ADMIN'" [routerLink]="['users-view']" mat-raised-button>View users</button>
    <button *ngIf="isLoggedIn()" [routerLink]="['editAccount']" mat-raised-button>Edit Account</button>
    <button *ngIf="!isLoggedIn()" [routerLink]="['register']" mat-raised-button>Register</button>
    <button *ngIf="!isLoggedIn()" [routerLink]="['login']" mat-raised-button>Log in</button>
    <button [routerLink]="['home']" mat-raised-button>Home</button>
    <button *ngIf="isLoggedIn()" [routerLink]="['home']" (click)="logout()" mat-raised-button>Log out</button>
    <button *ngIf="role == 'OWNER'" [routerLink]="['ownerRatings']" mat-raised-button>My reviews</button>
    <button *ngIf="role == 'OWNER'" [routerLink]="['userReports']" mat-raised-button>Report guest</button>
    <button *ngIf="role == 'GUEST'" [routerLink]="['userReports']" mat-raised-button>Report owner</button>
    <button *ngIf="role=='GUEST'" [routerLink]="['favouriteAccommodations']" mat-raised-button>Favourite accommodations</button>
    <button *ngIf="role=='OWNER'" [routerLink]="['ownerReport']" mat-raised-button>Owner reports</button>
  </div>
</mat-toolbar>
